import React, { Component } from 'react';
import Navigation from './Navigation/Navigation';
import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import 'bootstrap/dist/css/bootstrap-theme.css';

class App extends Component {
  render() {
    return (
      <div className="App">
          {<Navigation />};
      </div>
    );
  }
}

export default App;
